        <div className=" success-div br-5 ">

            <p style={{color: 'rgba(62, 213, 62, 0.864)', fontSize:'14px' , marginTop:'2px'}}>{successM}</p>
        </div></div>

    </div>
        </div>
    )
}
export default success;
